public class Playlist {
    private String nome;
    private List<Musica> listaDeMusicas;

    public Playlist(String nome) {
        this.nome = nome;
        this.listaDeMusicas = new ArrayList<>();
    }

    public void criar() {
        System.out.println("Criando playlist: " + nome);
    }

    public void adicionarMusica(Musica musica) {
        listaDeMusicas.add(musica);
        System.out.println("Adicionando música: " + musica.getTitulo() + " à playlist " + nome);
    }

    public void removerMusica(Musica musica) {
        listaDeMusicas.remove(musica);
        System.out.println("Removendo música: " + musica.getTitulo() + " da playlist " + nome);
    }

    public void editar(String novoNome) {
        this.nome = novoNome;
        System.out.println("Editando nome da playlist para: " + novoNome);
    }
}

public class Musica {
    private String titulo;
    private String artista;
    private int duracao; // duração em segundos
    private String album;

    public Musica(String titulo, String artista, int duracao, String album) {
        this.titulo = titulo;
        this.artista = artista;
        this.duracao = duracao;
        this.album = album;
    }

    public void tocar() {
        System.out.println("Tocando: " + titulo + " - " + artista);
    }

    public void pausar() {
        System.out.println("Pausando: " + titulo + " - " + artista);
    }

    public void parar() {
        System.out.println("Parando: " + titulo + " - " + artista);
    }

    public void avancar() {
        System.out.println("Avançando para a próxima música");
    }

    public void retroceder() {
        System.out.println("Retrocedendo para a música anterior");
    }
}
